import React from 'react';
import './App.css';
import axios from 'axios';

class App extends React.Component{
  state = {
    data:null
  }

  componentDidMount() {
    axios.get('http://localhost:5000')
    .then((response) => {
      this.setState({
        data: response.data
      })
    })
    .catch((error) => {
      console.error('Error fetching data: ${error}');
    })
  }

  render(){
    return (
      <div className="App">
        <header className="App-Header">
          GoodThings
        </header>
      </div>
    );
  }
}

export default App;
